import prettyReact from './images/pretty-react-logo.png.svg';
import hare from './images/hare.jpg';
import dinning from './images/dinning-and-kitchen.jpg';


export default function Footer() {
  return (
    <footer>
        <div className='react'>
            <img src={ prettyReact } alt='react logo'/>
        </div>
        <div>
            <img src={ hare } alt='hare logo'/>
        </div>
        <div>
        <img src={ dinning } alt='dinning logo'/>
        </div>
    </footer>
  );
};
